import React, { Component } from "react";

class Button extends Component {
  constructor(props) {
    super(props);
    this.state = {};

    this.rifilloLojen = this.rifilloLojen.bind(this);
  }
  rifilloLojen() {
    this.props.rifilloLojen();
  }
  render() {
    return (
      <div>
        <button
          style={{ backgroundColor: `${this.props.ngjyra}`, color: "black" }}
          onClick={() => this.rifilloLojen}
        >
          {this.props.name}
        </button>
      </div>
    );
  }
}

export default Button;
